package chillOut;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int x=5;

switch(x)
{
case 1:System.out.println("1 st rank");
break;
case 2:System.out.println("2nd rank");
break;
case 3:System.out.println("3 rd rank");
break;
case 4:
	System.out.println("4 th rank");
	break;
default:
	System.out.println("enter correct value");
}
	}

}
//switch will check more than 1 condition